10 Anonymous Sex Confessions Turned Into Explicit Short Films.
XConfessions is a project that combines Erika Lust's groundbreaking style of sult filmmaking with the public's own sex stories and fantasies. At xconfessions, users submit anonymous posts, and each month Erika picks her two favorites to run into explicit short films. This second compilation features 10 of the best confessions featured on the site in early 2014.
